import React from 'react';
import styled from 'styled-components';

function SearchBody() {
	return (
		<ComponentWrapper>
			<div className="Search_sectionContainer__UaVWv">
				<h2 className="Search_searchLabel__fOBpt">
					연관 직무<span>1</span>
				</h2>
				<div className="CategoryTags_tagBar__52K3J">
					<a
						href="/wdlist/518/669"
						className="CategoryTags_tagItem__cN5tk"
						aria-label=""
						target="_blank"
						rel="noopener noreferrer"
					>
						프론트엔드 개발자
					</a>
				</div>
			</div>
			<div className="Search_sectionContainer__UaVWv">
				<h2 className="Search_searchLabel__fOBpt">
					회사<span>2</span>
				</h2>
				<div className="CompanyList_className__onSYS"></div>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	margin: 60px auto 80px;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
	.Search_sectionContainer__UaVWv {
		padding-bottom: 60px;
	}
	.Search_searchLabel__fOBpt {
		font-size: 24px;
		font-weight: 600;
		line-height: 36px;
		margin-bottom: 18px;
		color: #333;
		> span {
			margin-left: 10px;
			font-weight: 400;
		}
	}
	.CategoryTags_tagBar__52K3J {
		position: relative;
		width: 100%;
		text-align: left;
		.CategoryTags_tagItem__cN5tk {
			display: inline-block;
			background-color: #fff;
			text-align: center;
			padding: 0 18px;
			height: 40px;
			line-height: 40px;
			border: 1px solid #e1e2e3;
			border-radius: 20px;
			font-size: 16px;
			font-weight: 400;
			color: #333;
			margin: 0 6px 6px 0;
			font-family: inherit;
		}
	}

	.CompanyList_className__onSYS {
		margin: -10px;
		position: relative;
		scrollbar-width: none;
	}
`;

export default SearchBody;
